      .custom-dots {
        display: flex;
        justify-content: center;
        align-items: center;
        gap: 12px;
        margin-top: 15px;
      }
      .custom-dot {
        width: 12px;
        height: 12px;
        position: relative;
        cursor: pointer;
      }
      .custom-dot::before {
        content: "";
        position: absolute;
        width: 100%;
        height: 100%;
        background: #ddd;
        border-radius: 50%;
        transition: all 0.3s ease;
      }
      .custom-dot::after {
        content: "";
        position: absolute;
        width: 100%;
        height: 100%;
        background: #333;
        border-radius: 50%;
        transform: scale(0);
        transition: transform 0.3s ease;
      }
      .custom-dot.active::before {
        transform: scale(1.5);
        opacity: 0.3;
      }
      .custom-dot.active::after {
        transform: scale(1);
      }
      .custom-dot:hover::before {
        opacity: 0.5;
      }
      .scroll-hidden {
        -ms-overflow-style: none;
        scrollbar-width: none;
      }
      .scroll-hidden::-webkit-scrollbar {
        display: none;
      }
      * {
        -ms-overflow-style: none; /* IE and Edge */
        scrollbar-width: none; /* Firefox */
      }

      *::-webkit-scrollbar {
        display: none; /* Chrome, Safari and Opera */
      }
      .custom-nav-buttons {
        display: flex;
        justify-content: space-between;
        position: absolute;
        width: 100%;
        top: 50%;
        transform: translateY(-50%);
        z-index: 1;
      }

      .custom-prev,
      .custom-next {
        cursor: pointer;
        padding: 10px;
        background: rgba(255, 255, 255, 0.8);
        border-radius: 50%;
        width: 40px;
        height: 40px;
        display: flex;
        align-items: center;
        justify-content: center;
        transition: all 0.3s ease;
      }
      .custom-nav-buttons {
        display: flex;
        justify-content: space-between;
        position: absolute;
        width: 100%;
        top: 50%;
        transform: translateY(-50%);
        z-index: 1;
      }
      .custom-prev:hover,
      .custom-next:hover {
        background: rgba(255, 255, 255, 1);
      }
    </style>
  </head>

        >
          <img class="content1 w-full" alt="content" />

          class="w-full max-w-[100%] mx-auto flex justify-center items-center absolute top-0"

          class="w-full max-w-[100%] mx-auto flex justify-center items-center absolute top-0"

        <div class="p-5 w-full fixed bottom-0 mx-auto">
          <button
            id="yellowBtn"

            onclick="mraid.open()"

    <script
      src="https://cdnjs.cloudflare.com/ajax/libs/jquery/3.7.1/jquery.min.js"
      integrity="sha512-v2CJ7UaYy4JwqLDIrZUI/4hqeoQieOmAZNXBeQyjo21dadnwR+8ZaIJVT8EE2iyI61OV8e6M8PP2/4hpQINQ/g=="
      crossorigin="anonymous"
      referrerpolicy="no-referrer"
    ></script>
    <script
      src="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.9.0/slick.min.js"
      integrity="sha512-HGOnQO9+SP1V92SrtZfjqxxtLmVzqZpjFFekvzZVWoiASSQgSr4cw9Kqd2+l8Llp4Gm0G8GIFJ4ddwZilcdb8A=="
      crossorigin="anonymous"
      referrerpolicy="no-referrer"
    ></script>
    <script>
      (function () {
        const mraid = window.mraid || {};
        let isViewable = false;
        let scrollInterval;
        let isAutoScrolling = true;

        // Configuration Constants
        const SCROLL_SPEED = 1; // Pixels per tick
        const SCROLL_INTERVAL = 50; // Milliseconds
        const FALLBACK_DELAY = 1000; // Delay for non-MRAID environments
        const content = document.getElementById("content");

        // Utility: Starts auto-scrolling
        const startAutoScroll = () => {
          if (!isAutoScrolling) return;
          scrollInterval = setInterval(() => {
            content.scrollTop += SCROLL_SPEED;
            if (
              content.scrollHeight - content.scrollTop <=
              content.clientHeight
            ) {
              content.scrollTop = 0; // Reset scroll to top
            }
          }, SCROLL_INTERVAL);
        };

        // Utility: Stops auto-scrolling
        const stopAutoScroll = () => {
          isAutoScrolling = false;
          clearInterval(scrollInterval);
        };

        // Utility: Handles click actions
        const handleClickAction = () => {
          if (mraid.open && typeof mraid.open === "function") {
            mraid.open();
          } else {
            window.open();
          }
        };

        // Add click event listeners to specified selectors
        const addClickHandlers = (selectors) => {
          selectors.forEach((selector) => {
            document.querySelectorAll(selector).forEach((element) => {
              element.addEventListener("click", (e) => {
                e.preventDefault();
                handleClickAction();
              });
            });
          });
        };

        // Initialize scrolling and content visibility
        const initializeScrolling = () => {
          content.style.display = "block"; // Ensure content is visible
          if (
            isViewable &&
            mraid.isViewable &&
            typeof mraid.isViewable === "function" &&
            mraid.isViewable()
          ) {
            startAutoScroll();
          }
        };

        // Initialize MRAID functionality
        const initializeMraid = () => {
          if (mraid && typeof mraid.getState === "function") {
            const state = mraid.getState();
            if (state === "loading") {
              mraid.addEventListener("ready", () => {
                isViewable = true;
                initializeScrolling();
              });
            } else {
              isViewable = true;
              initializeScrolling();
            }
          } else {
            // Fallback for non-MRAID environments
            setTimeout(initializeScrolling, FALLBACK_DELAY);
          }
        };

        // Add user interaction event listeners to stop auto-scrolling
        const addUserInteractionListeners = () => {
          ["touchstart", "mousedown", "wheel"].forEach((eventType) => {
            content.addEventListener(eventType, stopAutoScroll, {
              passive: true,
            });
          });
        };

        // Initialization logic
        const initialize = () => {
          addClickHandlers([".cta"]);
          addUserInteractionListeners();
          initializeMraid();
        };

        // Start initialization when the DOM is ready
        if (document.readyState === "loading") {
          document.addEventListener("DOMContentLoaded", initialize);
        } else {
          initialize();
        }
      })();
    </script>
    <script
      src="https://cdnjs.cloudflare.com/ajax/libs/OwlCarousel2/2.3.4/owl.carousel.min.js"
      integrity="sha512-bPs7Ae6pVvhOSiIcyUClR7/q2OAsRiovw4vAkX+zJbw3ShAeeqezq50RIIcIURq7Oa20rW2n2q+fyXBNcU9lrw=="
      crossorigin="anonymous"
      referrerpolicy="no-referrer"
    ></script>
    <script>
      document.addEventListener("DOMContentLoaded", function () {
        const contents = document.querySelectorAll('[class^="content"]');
        let currentIndex = 0;

        contents.forEach((content, index) => {
          if (index === 0) {
            content.parentElement.style.display = "flex";
          } else {
            content.parentElement.style.display = "none";
          }
        });

        document.addEventListener("click", function () {
          contents[currentIndex].parentElement.style.display = "none";

          currentIndex = (currentIndex + 1) % contents.length;

          contents[currentIndex].parentElement.style.display = "flex";
        });
      });
      $(document).ready(function () {
        const $carousel = $(".owl-carousel");
        const $customDots = $(".custom-dots");

        $carousel.wrap(
          '<div class="carousel-wrapper position-relative"></div>'
        );
        $(".carousel-wrapper").append(`
          <div class="custom-nav-buttons">
            <img class="custom-prev carousel-btn rotate-180"/>
            <img class="custom-next carousel-btn"/>
          </div>
        `);
        $carousel.slick({
          dots: false,
          infinite: true,
          speed: 500,
          slidesToShow: 1,
          adaptiveHeight: true,
          arrows: true,
          autoplay: true,
          autoplaySpeed: 2000,
        });

        $(".custom-prev").on("click", function () {
          $carousel.slick("slickPrev");
        });

        $(".custom-next").on("click", function () {
          $carousel.slick("slickNext");
        });
        function createCustomDots() {
          const slideCount = $carousel.slick("getSlick").slideCount;
          console.log(slideCount);
          for (let i = 0; i < slideCount; i++) {
            const dot = $(
              "<div class='custom-dot' data-slide='" + i + "'></div>"
            );
            $customDots.append(dot);
          }
          $(".custom-dot").first().addClass("active");
        }

        $carousel.on(
          "beforeChange",
          function (event, slick, currentSlide, nextSlide) {
            $(".custom-dot").removeClass("active");
            $(".custom-dot[data-slide='" + nextSlide + "']").addClass("active");
          }
        );

        $(document).on("click", ".custom-dot", function () {
          const slideIndex = $(this).data("slide");
          $(this).addClass("clicked");
          setTimeout(() => {
            $(this).removeClass("clicked");
          }, 200);
          $carousel.slick("slickGoTo", slideIndex);
        });

        createCustomDots();
      });
    </script>
  </body>
</html>
